import TshirtData from "./TshirtData";

const Tshirt = (props) => {
    return (
        <div>
            <ul>
                {props.list.map(item => (
                    <li key={item.id}>
                        <TshirtData
                            name={item.name}
                            description={item.description}
                            price={item.price}
                        />
                    </li>
                ))}
                <div>
                    <button>Large {Lquantity}</button>
                    <button>Medium {Mquantity}</button>
                    <button>Small {Squantity}</button>
                </div>
            </ul>
        </div>
    );
};

export default Tshirt;
